import React from "react";
import PostCardStyleHome from "./Cards/PostCardStyleHome";

function NewsGrid({
  editorPackSectionDatas,
  dataLength = "2",
  gridClasses = "col-lg-3 col-md-6",
}) {
  return (
    <div className="row g-0">
      Henry
      {/* editorPackSectionDatas */}
      <div key={editorItems.id} className={gridClasses}>
        Henrico
        <PostCardStyleHome
          datas={{
            image: editorPackSectionDatas.image,
            category: "Technology",
            date: editorPackSectionDatas.date,
            title: editorPackSectionDatas.title,
          }}
        />
      </div>
    </div>
  );
}

export default NewsGrid;
